export function User(first_name, last_name, name, email, image_url, bio, major, minor) {
  this.first_name = first_name;
  this.last_name = last_name;
  this.name = name;
  this.email = email;
  this.image_url = image_url;
  this.bio = bio;
  this.major = major;
  this.minor = minor;
}

export function parseUser(data) {
  const user = new User(data.first_name, data.last_name, data.name, )
}
